                                    `type`="number"),
                                list(
                                    `name`="test", 
                                    `title`="Statistics", 
                                    `type`="number"),
                                list(
                                    `name`="p", 
                                    `type`="number", 
                                    `format`="zto,pvalue"))))
                        self$add(jmvcore::Image$new(
                            options=options,
                            name="qqplot",
                            title="Q-Q Plot",
                            visible="(qq_plot)",
                            width=450,
                            height=400,
                            renderFun=".qqPlot",
                            requiresData=TRUE,
                            clearWith=list(
                                "dep",
                                "model_terms")))
                        self$add(jmvcore::Image$new(
                            options=options,
                            name="normPlot",
                            title="Residual histogram",
                            visible="(norm_plot)",
                            width=450,
                            height=400,
                            renderFun=".normPlot",
                            requiresData=TRUE,
                            clearWith=list(
                                "dep",
                                "dep_scale",
                                "model_terms")))
                        self$add(jmvcore::Image$new(
                            options=options,
                            name="residPlot",
                            title="Residual-Predicted Scatterplot",
                            visible="(resid_plot)",
                            width=450,
                            height=400,
                            renderFun=".residPlot",
                            requiresData=TRUE,
                            clearWith=list(
                                "dep",
                                "model_terms",
                                "dep_scale")))}))$new(options=options))
            self$add(jmvcore::Output$new(
                options=options,
                name="predicted",
                title="Predicted Vales",
                varTitle="`GLM_PRED_${ dep }`",
                varDescription="Predicted values",
                clearWith=list(
                    "dep",
                    "model_terms")))
            self$add(jmvcore::Output$new(
                options=options,
                name="residuals",
                title="Residuals Vales",
                varTitle="`GLM_RES_${ dep }`",
                varDescription="Residuals values",
                clearWith=list(
                    "dep",
                    "model_terms")))},
        .setModel=function(x) private$..model <- x))

